import { useState, useEffect } from 'react';
import axios from 'axios';
import '../App.css';

function UpdDelFlight() {
    const [listOfFlights, setListOfFlights] = useState([]);

    useEffect(() => {
        axios.get("http://localhost:8000/admin/showFlight")
        .then((result) => {
            setListOfFlights(result.data);
        })
        .catch((err) => {
            console.log(err);
        });
    }, []);

    return (
        <div className="">
          {listOfFlights.map((val) => {
              return <div> {val.flightNumber} {val.departureTime} {val.arrivalTime} {val.numberofEconomySeats} {val.arrivalDate} {val.departureDate} {val.numberofBusinessSeats} {val.airport} </div>
          })}
        </div>

      );
}

export default UpdDelFlight;
